import React from "react";
import { ClieFormContainer, ClienteContainer } from "./Cliente.Style";

export const Cliente = () => {
  return (
    <ClienteContainer>
      <ClieFormContainer>
        <div className="title">Cadastro de Cliente</div>
      </ClieFormContainer>
    </ClienteContainer>
  );
};
